define({"topics" : [{"title":"Adding a predefined panel","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> has a wide range of predefined panels that     you can choose from to present data from your project.\n                     </p>\n                  ","id":"Dashboard_add_predefined_panel","href":"TA_Help\/Topics\/Dashboard_add_predefined_panel.html","menu": {"hasChildren":false,},"tocID":"Dashboard_add_predefined_panel-d46e28002","topics":[]},{"title":"Cloning a panel","shortdesc":"\n                     <p class=\"shortdesc\">Cloning a panel is a way to quickly copy an existing panel including all customized     settings.</p>\n                  ","id":"Dashboard_clone_panel","href":"TA_Help\/Topics\/Dashboard_clone_panel.html","menu": {"hasChildren":false,},"tocID":"Dashboard_clone_panel-d46e28015","topics":[]},{"title":"Updating a panel","shortdesc":"\n                     <p class=\"shortdesc\">Updating     a panel refreshes the panel with the latest filtering data from the data     profile.</p>\n                  ","id":"Dashboard_update_panel","href":"TA_Help\/Topics\/Dashboard_update_panel.html","menu": {"hasChildren":false,},"tocID":"Dashboard_update_panel-d46e28026","topics":[]},{"title":"Panel templates","shortdesc":"\n                     <p class=\"shortdesc\">A panel template provides the basic framework that brings together common elements found     in Dashboard panels.</p>\n                  ","id":"Dashboard_panel_templates","href":"TA_Help\/Topics\/Dashboard_panel_templates.html","menu": {"hasChildren":false,},"tocID":"Dashboard_panel_templates-d46e28047","next":"Dashboard_panel_templates-d46e28047",},{"title":"Chart settings","shortdesc":"\n                     <p class=\"shortdesc\">You     can customize how data are presented on a chart panel.</p>\n                  ","id":"Dashboard_Chart_settings","href":"TA_Help\/Topics\/Dashboard_chart.html","menu": {"hasChildren":false,},"tocID":"Dashboard_Chart_settings-d46e28104","next":"Dashboard_Chart_settings-d46e28104",},{"title":"Indicator settings","shortdesc":"\n                     <p class=\"shortdesc\">An indicator panel displays user-selectable data in a tabular format, in which data     meeting a certain criteria can be\n                        highlighted for quick viewing.\n                     </p>\n                  ","id":"Dashboard_Indicator_settings","href":"TA_Help\/Topics\/Dashboard_indicator.html","menu": {"hasChildren":false,},"tocID":"Dashboard_Indicator_settings-d46e28147","next":"Dashboard_Indicator_settings-d46e28147",},{"title":"Report settings","shortdesc":"\n                     <p class=\"shortdesc\">A     report displays detailed information on the progress of a test and gives insight into the test     runs and their results.\n                        \n                     </p>\n                  ","id":"Dashboard_report","href":"TA_Help\/Topics\/Dashboard_report.html","menu": {"hasChildren":false,},"tocID":"Dashboard_report-d46e28189","next":"Dashboard_report-d46e28189",},{"title":"Heat map settings","shortdesc":"\n                     <p class=\"shortdesc\">A     heat map panel displays user-selectable data in a graphical tabular format where data meeting     certain criteria that\n                        occur in a consecutive manner are noted and highlighted for quick     viewing.\n                     </p>\n                  ","id":"Dashboard_heat_map","href":"TA_Help\/Topics\/Dashboard_heatmap.html","menu": {"hasChildren":false,},"tocID":"Dashboard_heat_map-d46e28238","next":"Dashboard_heat_map-d46e28238",}]});